#
# TABLE STRUCTURE FOR: aparat_p
#

DROP TABLE IF EXISTS aparat_p;

CREATE TABLE `aparat_p` (
  `id_aparat_p` int(3) NOT NULL AUTO_INCREMENT,
  `id_aparat` int(3) NOT NULL,
  `title` varchar(50) NOT NULL,
  PRIMARY KEY (`id_aparat_p`)
) ENGINE=MyISAM AUTO_INCREMENT=775 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: aparaty
#

DROP TABLE IF EXISTS aparaty;

CREATE TABLE `aparaty` (
  `id_aparat` int(4) NOT NULL AUTO_INCREMENT,
  `aparat_name` text NOT NULL,
  PRIMARY KEY (`id_aparat`)
) ENGINE=MyISAM AUTO_INCREMENT=156 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: cash
#

DROP TABLE IF EXISTS cash;

CREATE TABLE `cash` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `name` text NOT NULL,
  `plus` float NOT NULL DEFAULT '0',
  `minus` float NOT NULL DEFAULT '0',
  `id_kvitancy` int(8) DEFAULT NULL,
  `update_user` int(8) DEFAULT NULL,
  `update_time` time DEFAULT '00:00:00',
  `id_sc` int(2) NOT NULL,
  `update_date` date NOT NULL DEFAULT '0000-00-00',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: ci_cookies
#

DROP TABLE IF EXISTS ci_cookies;

CREATE TABLE `ci_cookies` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cookie_id` varchar(255) DEFAULT NULL,
  `netid` varchar(255) DEFAULT NULL,
  `ip_address` varchar(255) DEFAULT NULL,
  `user_agent` varchar(255) DEFAULT NULL,
  `orig_page_requested` varchar(120) DEFAULT NULL,
  `php_session_id` varchar(40) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: ci_sessions
#

DROP TABLE IF EXISTS ci_sessions;

CREATE TABLE `ci_sessions` (
  `session_id` varchar(40) NOT NULL DEFAULT '0',
  `ip_address` varchar(45) NOT NULL DEFAULT '0',
  `user_agent` varchar(120) NOT NULL,
  `last_activity` int(10) unsigned NOT NULL DEFAULT '0',
  `user_data` text NOT NULL,
  PRIMARY KEY (`session_id`),
  KEY `last_activity_idx` (`last_activity`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clients
#

DROP TABLE IF EXISTS clients;

CREATE TABLE `clients` (
  `user_id` int(4) NOT NULL AUTO_INCREMENT,
  `id_sc` int(4) DEFAULT '1',
  `fam` text NOT NULL,
  `imya` text NOT NULL,
  `otch` text NOT NULL,
  `login` text NOT NULL,
  `password` text NOT NULL,
  `mail` text NOT NULL,
  `send_mail` datetime NOT NULL,
  `phone` text NOT NULL,
  `adres` text NOT NULL,
  `gorod_id` int(4) NOT NULL,
  `id_group` int(4) NOT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=cp1251;

#
# TABLE STRUCTURE FOR: comments
#

DROP TABLE IF EXISTS comments;

CREATE TABLE `comments` (
  `id_comment` int(4) NOT NULL AUTO_INCREMENT,
  `date` datetime DEFAULT '0000-00-00 00:00:00',
  `comment` text NOT NULL,
  `id_user` int(4) DEFAULT NULL,
  `id_kvitancy` int(4) NOT NULL,
  PRIMARY KEY (`id_comment`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: goroda
#

DROP TABLE IF EXISTS goroda;

CREATE TABLE `goroda` (
  `gorod_id` int(4) NOT NULL AUTO_INCREMENT,
  `gorod` text NOT NULL,
  PRIMARY KEY (`gorod_id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: groups_dostupa
#

DROP TABLE IF EXISTS groups_dostupa;

CREATE TABLE `groups_dostupa` (
  `id` tinyint(4) NOT NULL AUTO_INCREMENT,
  `name` varchar(16) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: kvitancy
#

DROP TABLE IF EXISTS kvitancy;

CREATE TABLE `kvitancy` (
  `id_kvitancy` int(4) NOT NULL AUTO_INCREMENT,
  `user_id` int(4) DEFAULT '1',
  `id_aparat` int(4) DEFAULT NULL,
  `id_proizvod` int(4) NOT NULL DEFAULT '0',
  `model` text NOT NULL,
  `ser_nomer` text NOT NULL,
  `id_remonta` int(4) DEFAULT NULL,
  `neispravnost` text NOT NULL,
  `vid` text NOT NULL,
  `komplektnost` text,
  `date_priemka` date DEFAULT '0000-00-00',
  `date_okonchan` date DEFAULT '0000-00-00',
  `date_vydachi` date DEFAULT '0000-00-00',
  `id_sost` int(4) DEFAULT NULL,
  `id_mechanic` int(4) DEFAULT NULL,
  `id_sc` int(2) NOT NULL DEFAULT '1',
  `primechaniya` text,
  `comments` text NOT NULL,
  `update_time` text NOT NULL,
  `update_user` text NOT NULL,
  `id_where` int(11) NOT NULL,
  `id_responsible` int(11) NOT NULL,
  `full_cost` decimal(16,2) NOT NULL DEFAULT '0.00',
  PRIMARY KEY (`id_kvitancy`)
) ENGINE=MyISAM AUTO_INCREMENT=14785 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: membership
#

DROP TABLE IF EXISTS membership;

CREATE TABLE `membership` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `first_name` varchar(255) DEFAULT NULL,
  `last_name` varchar(255) DEFAULT NULL,
  `email_addres` varchar(255) DEFAULT NULL,
  `user_name` varchar(255) DEFAULT NULL,
  `pass_word` varchar(32) DEFAULT NULL,
  `id_group` int(1) NOT NULL,
  `id_sc` int(2) NOT NULL,
  `active` int(1) DEFAULT '1',
  `show_my_tickets` int(1) DEFAULT '1',
  `show_call_tickets` int(1) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: parts
#

DROP TABLE IF EXISTS parts;

CREATE TABLE `parts` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `name` text NOT NULL,
  `id_aparat` int(4) NOT NULL DEFAULT '0',
  `id_aparat_p` int(4) NOT NULL DEFAULT '0',
  `id_proizvod` int(4) NOT NULL DEFAULT '0',
  `model` text,
  `serial` text,
  `vid` text,
  `id_sost` int(1) NOT NULL DEFAULT '1',
  `user_id` int(4) DEFAULT '1',
  `date_priemka` date DEFAULT '0000-00-00',
  `date_vydachi` date DEFAULT '0000-00-00',
  `cost` float NOT NULL DEFAULT '0',
  `price` float NOT NULL DEFAULT '0',
  `status` int(1) DEFAULT '1',
  `id_kvitancy` int(8) DEFAULT NULL,
  `update_user` int(8) DEFAULT NULL,
  `update_time` varchar(100) DEFAULT NULL,
  `id_resp` int(8) DEFAULT NULL,
  `id_from` varchar(100) DEFAULT NULL,
  `id_where` int(1) NOT NULL,
  `id_sc` int(2) NOT NULL,
  `text` text,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=98 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: people
#

DROP TABLE IF EXISTS people;

CREATE TABLE `people` (
  `PersonId` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `Name` varchar(45) NOT NULL,
  `Age` int(10) unsigned NOT NULL,
  `RecordDate` datetime NOT NULL,
  PRIMARY KEY (`PersonId`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=latin5;



#
# TABLE STRUCTURE FOR: proizvoditel
#

DROP TABLE IF EXISTS proizvoditel;

CREATE TABLE `proizvoditel` (
  `id_proizvod` int(4) NOT NULL AUTO_INCREMENT,
  `name_proizvod` varchar(50) NOT NULL,
  PRIMARY KEY (`id_proizvod`)
) ENGINE=MyISAM AUTO_INCREMENT=454 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: service_centers
#

DROP TABLE IF EXISTS service_centers;

CREATE TABLE `service_centers` (
  `id_sc` int(4) NOT NULL AUTO_INCREMENT,
  `id_gorod` int(4) NOT NULL,
  `site` varchar(50) DEFAULT NULL,
  `name_sc` text NOT NULL,
  `adres_sc` text NOT NULL,
  `phone_sc` text NOT NULL,
  `kontakt_sc` text NOT NULL,
  `mail_sc` text NOT NULL,
  `rab_sc` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`id_sc`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=cp1251 PACK_KEYS=0;



#
# TABLE STRUCTURE FOR: sost_remonta
#

DROP TABLE IF EXISTS sost_remonta;

CREATE TABLE `sost_remonta` (
  `id_sost` int(4) NOT NULL AUTO_INCREMENT,
  `name_sost` text,
  `background` varchar(20) NOT NULL,
  `type` int(1) DEFAULT '1',
  `call2client` int(1) DEFAULT '0',
  PRIMARY KEY (`id_sost`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: store
#

DROP TABLE IF EXISTS store;

CREATE TABLE `store` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `name` text NOT NULL,
  `id_aparat` int(4) NOT NULL DEFAULT '0',
  `id_aparat_p` int(4) NOT NULL DEFAULT '0',
  `id_proizvod` int(4) NOT NULL DEFAULT '0',
  `model` text,
  `serial` text,
  `vid` text,
  `id_sost` int(1) NOT NULL DEFAULT '1',
  `user_id` int(4) DEFAULT '1',
  `date_priemka` date DEFAULT '0000-00-00',
  `date_vydachi` date DEFAULT '0000-00-00',
  `cost` float NOT NULL DEFAULT '0',
  `price` float NOT NULL DEFAULT '0',
  `status` int(1) DEFAULT '1',
  `id_kvitancy` int(8) DEFAULT NULL,
  `update_user` int(8) DEFAULT NULL,
  `update_time` varchar(100) DEFAULT NULL,
  `id_resp` int(8) DEFAULT NULL,
  `id_from` varchar(100) DEFAULT NULL,
  `id_where` int(1) NOT NULL,
  `id_sc` int(2) NOT NULL,
  `text` text,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=86 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS users;

CREATE TABLE `users` (
  `user_id` int(4) NOT NULL AUTO_INCREMENT,
  `id_sc` int(4) DEFAULT '1',
  `fam` text NOT NULL,
  `imya` text NOT NULL,
  `otch` text NOT NULL,
  `login` text NOT NULL,
  `password` text NOT NULL,
  `mail` text NOT NULL,
  `send_mail` datetime NOT NULL,
  `phone` text NOT NULL,
  `adres` text NOT NULL,
  `zavod` text NOT NULL,
  `gorod_id` int(4) NOT NULL,
  `id_group` int(4) NOT NULL,
  `id_portret` int(4) NOT NULL DEFAULT '1',
  `user_hash` text NOT NULL,
  `active` int(1) NOT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: vid_remonta
#

DROP TABLE IF EXISTS vid_remonta;

CREATE TABLE `vid_remonta` (
  `id_remonta` int(4) NOT NULL AUTO_INCREMENT,
  `name_remonta` text NOT NULL,
  PRIMARY KEY (`id_remonta`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=cp1251;



#
# TABLE STRUCTURE FOR: works
#

DROP TABLE IF EXISTS works;

CREATE TABLE `works` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `id_sc` int(1) NOT NULL,
  `date_added` varchar(100) NOT NULL,
  `name` varchar(200) NOT NULL,
  `cost` int(8) NOT NULL,
  `user_id` int(8) DEFAULT NULL,
  `id_kvitancy` int(8) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=cp1251;



